import React from 'react';
import { useSelector } from 'react-redux';

function Alert() {
  const { error } = useSelector(({ userReducer }) => userReducer);

  console.log(error);
  return (
    <div className="alert">
      {error.forEach((element) => {
        <div>{element}</div>;
      })}
    </div>
  );
}

export default Alert;
